<?php

namespace App\Http\Controllers;

use Illuminate\Http\Request;
use Illuminate\Support\Facades\Http;
use Illuminate\Http\JsonResponse;

class AIController extends Controller
{
    public function generate(string $prompt): JsonResponse
    {
        ini_set('max_execution_time', 1000); // 5 minutes

        $prompt = "Extract the following fields from the document image: date YYYY-MM-DD, timestamp MySQL DATETIME YYYY-MM-DD HH:MM:SS MUST include the extracted date, label, category. Rules: Use the image at C:\\Users\\Acer\\OneDrive\\Desktop\\Formal-Letter-for-Interview-Appointment.png. Ignore timezones. If a field is missing, use null. Valid output example: {\"date\":\"2026-01-19\",\"timestamp\":\"2026-01-19 10:00:00\",\"label\":\"Interview Appointment\",\"category\":\"Interview\"}";



        $response = Http::timeout(1000)->post('http://127.0.0.1:11434/api/generate', [
            'model'  => 'qwen2.5:1.5b',
            'prompt' => $prompt,
            'stream' => false,
        ]);



        return response()->json(
            $response->json(),
            $response->status()
        );
    }





